import React, { useState, useEffect } from 'react';
import { TextField, Button, Box, Autocomplete } from '@mui/material';
import './Checkout.css';

const Checkout = ({ totalCartValue, isCartEmpty, navigateToOrder }) => {
    const [formData, setFormData] = useState({
        name: '',
        phone: '',
        email: '',
        city: '',
        address: '',
        zipCode: '',
        instructions: '',
    });

    const [cityOptions, setCityOptions] = useState([]); // Store fetched cities
    const [loadingCities, setLoadingCities] = useState(false); // Track loading state

    // Fetch city data from the API
    useEffect(() => {
        const fetchCities = async () => {
            setLoadingCities(true);
            try {
                const response = await fetch(
                    'https://data.gov.il/api/3/action/datastore_search?resource_id=5c78e9fa-c2e2-4771-93ff-7f400a12f7ba&limit=1000'
                );
                const data = await response.json();
                const cities = data.result.records.map(record => record.city_name); // Adjust 'city_name' based on API response structure
                setCityOptions(cities);
            } catch (error) {
                console.error('Error fetching cities:', error);
            } finally {
                setLoadingCities(false);
            }
        };

        fetchCities();
    }, []);

    const handleInputChange = (e) => {
        const { name, value } = e.target;
        setFormData({ ...formData, [name]: value });
    };

    const handleCityChange = (event, value) => {
        setFormData({ ...formData, city: value || '' });
    };

    const handleFormSubmit = () => {
        if (!isCartEmpty) {
            console.log('User Delivery Details:', formData);
            navigateToOrder();
        }
    };

    const textFieldStyles = {
        '& .MuiInputLabel-root': {
            textAlign: 'right',
            right: 0,
            transformOrigin: 'top right',
        },
        '& .MuiInputBase-input': {
            textAlign: 'right',
        },
    };

    const totalPayment = (totalCartValue) => totalCartValue + 35;

    return (
        <div className="checkout-section">
            <h2>פרטי משלוח</h2>
            <Box
                className="checkout-customer-details"
                component="form"
                sx={{ display: 'flex', flexDirection: 'column', gap: 2, width: '80%', margin: '0 auto', mb: 10 }}
            >
                <TextField
                    name="name"
                    label="שם מלא"
                    variant="standard"
                    value={formData.name}
                    onChange={handleInputChange}
                    fullWidth
                    sx={textFieldStyles}
                />
                <TextField
                    name="phone"
                    label="טלפון"
                    variant="standard"
                    value={formData.phone}
                    onChange={handleInputChange}
                    fullWidth
                    sx={textFieldStyles}
                />
                <TextField
                    name="email"
                    label="דוא״ל"
                    variant="standard"
                    value={formData.email}
                    onChange={handleInputChange}
                    fullWidth
                    sx={textFieldStyles}
                />
                <Autocomplete
                    options={cityOptions}
                    value={formData.city}
                    onChange={handleCityChange}
                    loading={loadingCities}

                    renderInput={(params) => (
                        <TextField
                            {...params}
                            name="city"
                            label="עיר"
                            variant="standard"
                            fullWidth
                            sx={textFieldStyles}
                            InputProps={{
                                ...params.InputProps,
                                endAdornment: (
                                    <>
                                        {loadingCities ? <span>Loading...</span> : null}
                                        {params.InputProps.endAdornment}
                                    </>
                                ),
                            }}
                        />
                    )}
                />
                <TextField
                    name="address"
                    label="כתובת"
                    variant="standard"
                    value={formData.address}
                    onChange={handleInputChange}
                    fullWidth
                    sx={textFieldStyles}
                />
                <TextField
                    name="zipCode"
                    label="מיקוד"
                    variant="standard"
                    value={formData.zipCode}
                    onChange={handleInputChange}
                    fullWidth
                    sx={textFieldStyles}
                />
                <TextField
                    name="instructions"
                    label="הוראות"
                    variant="standard"
                    value={formData.instructions}
                    onChange={handleInputChange}
                    multiline
                    rows={4}
                    fullWidth
                    sx={textFieldStyles}
                />
            </Box>

            <div className="checkout-total">
                <div>
                    <span>סה"כ מחיר בעגלה:</span>
                    <span>₪{totalCartValue}</span>
                </div>
                <div>
                    <span>סה"כ מחיר משלוח:</span>
                    <span>₪35.00</span>
                </div>
                <div className="checkout-total-payment">
                    <span>סה"כ לתשלום:</span>
                    <span>₪{totalPayment(totalCartValue)}</span>
                </div>
            </div>

            <div className="checkout-button-container">
                <Button
                    className="checkout-button"
                    onClick={handleFormSubmit}
                    disabled={isCartEmpty}
                    variant="contained"
                    color="primary"
                >
                    המשך לתשלום
                </Button>
            </div>
        </div>
    );
};

export default Checkout;
